import Card, { PinkCard, TopBar, BottomBar } from "./Components.js";
import "./App.css";
import { useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";
import React from "react";

function PhishingScreen() {
  const navigate = useNavigate();

  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const handleResize = () => setIsMobile(window.innerWidth < 768);
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  return (
    <>
      <TopBar />
      <div
        style={{
          display: "flex",
          flexDirection: isMobile ? "column" : "row",
          alignItems: "center",
          justifyContent: "center",
          minHeight: isMobile ? "60vh" : "100vh",
          textAlign: "center",
          gap: isMobile ? "20px" : "40px",
          padding: isMobile ? "20px" : "0",
        }}
        className="background-color-verylightorange"
      >
        <div>
          <h1
            className={isMobile ? "muwatana-header-styling" : ""}
            style={{
              fontSize: isMobile ? "30px" : "45px",
              color: "darkorange",
            }}
          >
            Phishing
          </h1>
          {isMobile ? (
            <p>
              Phishing is a cyberattack where an attacker pretends to be a
              recognized organization, such as a bank or school, to trick the
              user into giving them sensitive information or to infect their
              device with malware. Sometimes, these attackers send links be sent
              by email, text messages, or even instant messages on applications
              such as WhatsApp.
            </p>
          ) : (
            <p style={{ fontSize: isMobile ? "14px" : "inherit" }}>
              Phishing is a cyberattack where an attacker pretends to be a
              recognized organization,<br/>such as a bank or school, to trick the
              user into giving them sensitive information or to infect<br/>their
              device with malware. Sometimes, these attackers send links<br/>be sent
              by email, text messages, or even instant messages on applications<br/>
              such as WhatsApp.
            </p>
          )}
        </div>
        <div>
          <img
            src={"Phishing-Email--Streamline-Milano.png"}
            alt="security"
            className="image-styling"
            style={{
              maxWidth: isMobile ? "80%" : "400px",
              height: "auto",
              margin: "0 auto",
            }}
          />
        </div>
      </div>
      <div
        style={{
          border: "none",
          backgroundColor: "rgb(247, 234, 236)",
          justifyContent: "center",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          maxWidth: "fit-content",
          borderRadius: "17px",
          margin: "30px auto",
          minHeight: "750px",
          height: "auto",
          padding: "30px 20px",
          boxShadow: "0px 4px 5px rgba(0, 0, 0, 0.3)",
        }}
      >
        <h1 style={{ fontSize: "45px", textAlign: "left", width: "100%" }}>
          To keep your account safe
        </h1>
        <InfoPackWithButton
          picture={"Vector.png"}
          title={<>Use a strong and unique password</>}
          description={
            <>
              Use a strong password on all your accounts (social media, email,
              instant messaging, etc.) and do not
              <br />
              use the same password for multiple accounts.
            </>
          }
        />
        <InfoPackWithButton
          picture={"Vector.png"}
          title={<>Keep your password a secret</>}
          description={
            <>
              Do not share your password with others and do not enter your
              password in front of others. If you think
              <br />
              your account has been infiltrated, change your password
              immediately.
            </>
          }
        />
        <SmallButton
          text={"Learn how to keep your password private from others"}
        />
        <InfoPackWithButton
          picture={"Vector.png"}
          title={<>Protect your account case</>}
          description={
            <>
              Log out of your account after using it on a device that is not
              yours.
            </>
          }
        />
        <InfoPackWithButton
          picture={"Vector.png"}
          title={<>Take advantage of security settings</>}
          description={
            <>
              Set up security & privacy settings in your account, such as
              limiting those who can see your posts to
              <br />
              "friends only", using two-factor authentication, and setting up
              spam protection
            </>
          }
        />
      </div>
      <BottomBar />
    </>
  );
}

export default PhishingScreen;
